import React from 'react';

class ImageList extends React.Component {
    render() {
        let { filterResult, onClickImage} = this.props;

        let countries = null;
        if (!!filterResult) {
            countries = filterResult.map((image) => (
                <li><img src={image.imageUrl} onClick={() => onClickImage(country)}></img></li>
            ));
        }
        return (
            <div id = "filterResult">
                <h3>
                    COUNTRY
                </h3>
                <ul>
                    {countries}
                </ul>
            </div>
        );
    }
}

export { ImageList }
